import { useContext, useMemo } from "react";
import AppContext from "../context/AppContext";
import Memes__list from "../memes__list/Memes__list";

const Hot__Memes = () => {
  const { memesDataState } = useContext(AppContext);
  const hotMemesData = useMemo(() => 
      memesDataState.filter((mem) => mem.upvotes - mem.downvotes > 5
    ),[memesDataState]);

  return <Memes__list memesData={hotMemesData} />;
};

export default Hot__Memes;
